export const fieldsObjOne = [
  {
    label: "Age",
    type: "number",
    validation: {
      required: true
    }
  },
  {
    label: "Full Name",
    type: "text",
    required: true
  },
  {
    label: "Date",
    type: "date",
    required: false
  },
  {
    label: "Password",
    type: "password",
    required: true
  }
];

export const fieldsObjTwo = [
  {
    label: "Age",
    type: "number",
    required: true,
    value: "34"
  },
  {
    label: "Full Name",
    type: "text",
    required: true,
    value: "Micky Mouse"
  },
  {
    label: "Date",
    type: "date",
    required: false,
    value: "2020-11-03"
  },
  {
    label: "Password",
    type: "password",
    required: true,
    value: "test"
  }
];
